  // @include respondTo(medium) {\n    //   visibility: hidden;\n    // } \n\n    // @include respondTo(large) {\n    //   visibility: hidden;\n    // } \n\n    // @include respondTo(x-large) {\n    //   visibility: hidden;\n    // }\n  }\n\n  ul {\n    height: inherit;\n    line-height: inherit;\n  }\n\n  &__item {\n    border-left: solid 1px _palette(border);\n    height: inherit;\n    line-height: inherit;\n    white-space: nowrap;\n\n    > * {\n      display: block;\n      float: left;\n    }\n\n    a {\n      @include icon;\n      border-bottom: 0;\n      color: _palette(fg-light);\n      overflow: hidden;\n      position: relative;\n      text-indent: 4em;\n      width: 4em;\n\n      display: block;\n      float: left;\n\n      &:before {\n        display: block;\n        height: inherit;\n        left: 0;\n        line-height: inherit;\n        position: absolute;\n        text-align: center;\n        text-indent: 0;\n        top: 0;\n        width: inherit;\n      }\n    }\n  }\n\n  &__item__search {\n    transition: all 0.5s ease;\n    // max-width: 0;\n    // opacity: 0;\n    width: 4em;\n    overflow: hidden;\n    padding: 0;\n    white-space: nowrap;\n\n    input {\n      width: 12em;\n    }\n\n    &.visible {\n      max-width: 12.5em;\n      opacity: 1;\n      padding: 0 0.5em 0 0;\n    }\n\n    // border: 1px solid red;\n\n    @include respondTo(small) {\n      display: none;\n    }\n  }\n}\n\n.searchForm {\n  margin: 0;\n\n  input {\n    display: inline-block;\n    height: 2.5em;\n    position: relative;\n    top: -2px;\n    vertical-align: middle;\n  }\n}\n\n","/// Makes an element's :before pseudoelement a FontAwesome icon.\n/// @param {string} $content Optional content value to use.\n/// @param {string} $where Optional pseudoelement to target (before or after).\n@mixin icon($content: false, $where: before) {\n\n\ttext-decoration: none;\n\n\t&:#{$where} {\n\n\t\t@if $content {\n\t\t\tcontent: $content;\n\t\t}\n\n\t\t-moz-osx-font-smoothing: grayscal